  const { ref, inView, entry} = useInView({
    threshold: 0,
});

  return (
    <>
    <Header/>
    <Hero ref={ref}/>
    <h2>{`Header inside viewport ${inView}.`}</h2>
    {console.log(inView)}
    <HomePortfolio />
    </>
  )
}
export default Home
